import React from 'react'
import './About.css'
import Card from "../Card/Card";
import Glasses from '../../img/glassesimoji.png'
import HeartEmoji from '../../img/heartemoji.png'
import Humble from '../../img/humble.png'


const About = () => {
    return (
        <div className="about">

            <div className="awesome">
            {/*    Left Side*/}
                <span>About Me</span>
                <span>Experience</span>
                <spane>
                    This is just some fucking witing so fuck you. Letr me add some more text
                    <br />
                    And here is an additional writing. Fuck I neeed these tutorials
                </spane>
                <button className="button s-button">Resume</button>
                <div className="blur s-blur1" style={{background: '#ABF1FF94'}}></div>
            </div>

            {/*Rigth Side */}
            <div className="cards">
                <div style={{left:'14rem'}}>
                    <Card
                    emoji = {HeartEmoji}
                    heading = {'Experience'}
                    details = { "2.5+ Years Working"}

                    />
                </div>
                <div style={{top: '12rem', left:'-4rem'}}>
                    <Card
                        emoji = {Glasses}
                        heading = {'Education'}
                        details = { "Bachelor of Science in Software Engineering"}

                    />
                </div>
                <div style={{top: '19rem', left:'12rem'}}>
                    <Card
                        emoji = {Humble}
                        heading = {'Freelance'}
                        details = { "10+ Completed"}

                    />
                </div>
            </div>


        </div>
    )
}

export default About
